import { Form } from "react-router-dom";
import { IQuestion } from "./types";

export interface Props {
	question: IQuestion;
}

function AnswerFormQuestionNote(props: Props) {
	const question = props.question;

	return (
		<div
			className="question-note"
			style={{
				backgroundImage: `url("/notes/yellow-note.png")`,
			}}
		>
			<div className="note-header">
				<div className="note-profile-pic">
					<img src="/test-anony-profile-pic.jpg" alt="" />
				</div>
				<div className="note-time">5분 전</div>
			</div>
			<div className="note-content-box">
				<div className="note-content">{question.questionContents}</div>
			</div>
			<hr className="note-hr" />
			<div className="note-answer-box">
				<Form method="post">
					<input type="text" name="questionContents" />
					<input type="text" name="questionHyperlink" />
					<button type="submit"></button>
				</Form>
			</div>
			<form method="post">
				<div>
					<label for="answerAdd">답변 폼</label>
					<textarea
						id="answerAdd"
						name="answerContents"
						placeholder="답변을 입력하세요"
					></textarea>
				</div>
				<div >
					<button type="submit">
						답변 등록
					</button>
				</div>
			</form>
			{/* <QuestionFooter question={question} /> */}
		</div>
	);
}

export default AnswerFormQuestionNote;
